import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
       <nav className="navbar">
        <ul>Hospitals</ul>
        <ul>Privacy Policy</ul>
        <ul>Contact Us</ul>
        <ul><button className="btn1">Admin Login</button></ul>
      </nav>
      <div className="logo">
        <h1>AIIMS<span> Dashboard.</span></h1>
      </div>
      <div className="aim">
        <h1>The <span>AIIMS</span> World of Care</h1>
      </div>
    </div>
  );
}

export default App;
